// Código mejorado para un nodo Code en n8n que extrae los componentes de múltiples URLs
// e incluye en el resultado las demás propiedades del objeto de entrada

const input = $input.all();
console.log('Input recibido:', JSON.stringify(input, null, 2));

const output = input.map(item => {
    console.log('Procesando item:', item);

    if (!item || !item.json || !item.json.URL || typeof item.json.URL !== 'string') {
        console.log('URL no válida:', item ? item.json.URL : null);
        return { json: { error: 'No valid URL found', original: item ? item.json.URL : null } };
    }

    let urlString = item.json.URL.trim(); // Limpiar espacios
    console.log('URL limpia:', urlString);

    try {
        // Separar la URL base de la query string
        const [baseURL, queryString] = urlString.split('?');
        console.log('Base URL:', baseURL);
        console.log('Query String:', queryString);

        // Objeto para almacenar los parámetros decodificados
        const decodedParams = {};

        if (queryString) {
            // Separa los parámetros por el carácter "&"
            queryString.split('&').forEach(param => {
                const equalIndex = param.indexOf('=');
                if (equalIndex !== -1) {
                    const key = param.substring(0, equalIndex);
                    let value = param.substring(equalIndex + 1);

                    // Reemplazar "+" por espacio antes de decodificar
                    value = value.replace(/\+/g, ' ');

                    // Decodificar el valor
                    let decodedValue = decodeURIComponent(value);

                    // Si el parámetro es "utm_medium" y por error se concatenó "utm_content", separamos ambos
                    if (key === 'utm_medium' && decodedValue.includes('utm_content=')) {
                        const parts = decodedValue.split('utm_content=');
                        decodedValue = parts[0];
                        if (!decodedParams['utm_content'] && parts[1]) {
                            decodedParams['utm_content'] = parts[1];
                        }
                    }

                    decodedParams[key] = decodedValue;
                    console.log(`Parámetro decodificado: ${key} = ${decodedParams[key]}`);
                }
            });
        }

        // Extraer las demás propiedades que vienen en el objeto (por ejemplo, "correo", "Data de conversão")
        // y excluir la propiedad "URL", ya que la hemos procesado.
        const extraFields = { ...item.json };
        delete extraFields.URL;

        // Combinar la baseURL, los parámetros decodificados y los campos extra
        const result = {
            json: {
                baseURL: baseURL,
                ...decodedParams,
                ...extraFields
            }
        };
        console.log('Resultado final:', JSON.stringify(result, null, 2));
        return result;
    } catch (error) {
        console.log('Error procesando URL:', error.message);
        return { json: { error: 'Invalid URL', original: item.json.URL, message: error.message } };
    }
});

console.log('Output final:', JSON.stringify(output, null, 2));
return output;
